7cf0ad8045aefbcf4e34dfafe89ba09c8db2c433.query:
select count(*) as total
from c_partner
where (exterior -> 'uid' != $2::jsonb) and (((interior -> 'authorized') @> ($1::jsonb)) or ((interior -> 'prime') @> ($1::jsonb)));

